/**
 * Converts an ES6 Map to an object, returning undefined if the map was empty.
 */
export function mapToOptionalObject(m) {
    if (!m || m.size === 0) {
        return undefined;
    }
    const o = {};
    m.forEach((v, k) => o[k] = v);
    return o;
}
/**
 * Converts an ES6 Map to an object, returning an object with no properties if the map was empty.
 */
export function mapToObject(m) {
    if (!m || m.size === 0) {
        return {};
    }
    const o = {};
    m.forEach((v, k) => o[k] = v);
    return o;
}
